import './Dishes.scss';
import { useParams } from "react-router-dom";
import restaurantsJson from "../../../../../assets/data/restaurants.json";
import dishesJson from "../../../../../assets/data/dishes.json";
import Dish from "../../../../types/Dish";
import Restaurant from "../../../../types/Restaurant";
// import Modal from "react-modal";

function Dishes() {

const params=useParams();
console.log("params ",params?.restaurantId);
const [dishes, setDishes] = useState<Dish[]>([]);
const [restaurant, setRestaurant] = useState<Restaurant>();

useEffect(() => {
  const current_restaurant = restaurantsJson.filter((item) => {
    return item.id === params.restaurantId;
  });
  setRestaurant(current_restaurant);
//   setRestaurant(() => [{ restaurant }])
  console.log("restaurant ",restaurant);
  restaurant.dishes_ids.map((item:number) => {
    for (let dish of dishesJson) {
      if (dish.id === item) {
          console.log("dish id: ",dish);
        // setSigntureDish((currentArray:any) => [...currentArray, { dish }])
      }
    }
  });
}, []);
return (
<div className="">
    dishes
</div> 

);
}

export default Dishes
